import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Dashboard() {
  const [predictions, setPredictions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchPredictions();
  }, []);

  const fetchPredictions = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/predict/history', {
        headers: { 'Authorization': `Bearer ${token}` }
      });
      
      setPredictions(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Failed to fetch predictions:', error);
      setLoading(false);
    }
  };

  const getSeverityClass = (severity) => {
    const classes = {
      'Critical': 'severity-critical',
      'Urgent': 'severity-urgent',
      'Moderate Risk': 'severity-moderate',
      'Mild': 'severity-mild'
    };
    return classes[severity] || '';
  };

  if (loading) {
    return <div className="container"><div className="loading">Loading...</div></div>;
  }

  return (
    <div className="container">
      <div className="dashboard-container">
        <h2>My Dashboard</h2>
        
        <div className="stats-grid">
          <div className="stat-card">
            <h3>Total Predictions</h3>
            <p className="stat-number">{predictions.length}</p>
          </div>
          
          <div className="stat-card">
            <h3>High Risk Results</h3>
            <p className="stat-number">
              {predictions.filter(p => p.severity_level === 'Critical' || p.severity_level === 'Urgent').length}
            </p>
          </div>
          
          <div className="stat-card">
            <h3>Recent Predictions</h3>
            <p className="stat-number">
              {predictions.filter(p => {
                const date = new Date(p.prediction_date);
                const weekAgo = new Date();
                weekAgo.setDate(weekAgo.getDate() - 7);
                return date >= weekAgo;
              }).length}
            </p>
          </div>
        </div>

        <h3>Prediction History</h3>
        
        {predictions.length === 0 ? (
          <p className="no-data">No predictions yet. Start by making a disease prediction.</p>
        ) : (
          <div className="table-container">
            <table className="predictions-table">
              <thead>
                <tr>
                  <th>Date</th>
                  <th>Disease</th>
                  <th>Result</th>
                  <th>Confidence</th>
                  <th>Severity</th>
                  <th>Hospital</th>
                </tr>
              </thead>
              <tbody>
                {predictions.map((pred) => (
                  <tr key={pred.prediction_id}>
                    <td>{new Date(pred.prediction_date).toLocaleDateString()}</td>
                    <td>{pred.disease_name}</td>
                    <td className={pred.prediction_result === 'Positive' ? 'result-positive' : 'result-negative'}>
                      {pred.prediction_result}
                    </td>
                    <td>{(pred.confidence_score * 100).toFixed(2)}%</td>
                    <td>
                      <span className={`severity-badge ${getSeverityClass(pred.severity_level)}`}>
                        {pred.severity_level}
                      </span>
                    </td>
                    <td>{pred.hospital_name || 'N/A'}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
